import { Container } from "react-bootstrap";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
import { Link, withRouter } from "react-router-dom";

function NavBar(props) {
  const { location } = props;
  console.log(location);
  return (
    <Container fluid>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand href="/">Proyecto BD ðŸ˜Ž</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/empresa">Empresa</Nav.Link>
            <Nav.Link href="/newempresa">AÃ±adir Empresa</Nav.Link>
            <Nav.Link href="/persona">Persona</Nav.Link>
            <Nav.Link href="/newpersona">AÃ±adir Persona</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </Container>
  );
}
export default withRouter(NavBar);
